import React from 'react';
import '../css/ModelTransferLanding.css';

function ModelTransferLanding () {
   
        return (
            <div className="bg-radius">
            <div className="model-landing">
                <div className="model-wrapper">
                    <img src="./images/cfmt_web.webp"/>
                </div>
                
            </div>
            <div className="model-mobile">
                <div className="model-mobile-wrapper">
                    <img src="./images/cfmt_mobile.webp"/>
                </div>
                
            </div>
            </div>
        );
    
}

export default ModelTransferLanding;
